import React, { useState, useEffect } from 'react';
import './Therapy.css'; // The new CSS file we will create

const allTherapists = [
    {id: 1, name: "Dr. Arnav Singh", specialization: "Clinical Psychology", price: 799, rating: 5.0, experience: "8 years", avatar: "üë®‚Äç‚öïÔ∏è", languages: ["Hindi", "English"], modes: ["Video", "Chat"], description: "Specialized in anxiety and depression treatment using evidence-based CBT techniques."},
    {id: 2, name: "Aaryan Kumar", specialization: "Counseling Psychology", price: 599, rating: 4.8, experience: "5 years", avatar: "üë®‚Äç‚öïÔ∏è", languages: ["Hindi", "English"], modes: ["Voice", "Chat"], description: "Focuses on youth mental health, career stress, and building healthy relationships."},
    {id: 3, name: "Dr. Ankur Verma", specialization: "Psychiatry", price: 999, rating: 4.9, experience: "12 years", avatar: "üë®‚Äç‚öïÔ∏è", languages: ["English"], modes: ["Video"], description: "MD in Psychiatry with expertise in medication management for complex cases."},
    {id: 4, name: "Aanchal Sharma", specialization: "Art Therapy", price: 499, rating: 4.7, experience: "4 years", avatar: "üé®", languages: ["Hindi"], modes: ["Video", "Chat"], description: "Uses creative processes to help clients explore emotions and reduce anxiety."},
    {id: 5, name: "Aakash Patel", specialization: "Cognitive Behavioral Therapy", price: 899, rating: 4.9, experience: "10 years", avatar: "üë®‚Äçüè´", languages: ["Hindi", "English", "Gujarati"], modes: ["Video", "Chat"], description: "CBT expert with a focus on identifying and changing negative thought patterns."},
    {id: 6, name: "Nitin Kumar", specialization: "Mindfulness & Meditation", price: 649, rating: 4.8, experience: "6 years", avatar: "üßò‚Äç‚ôÇÔ∏è", languages: ["English", "Hindi"], modes: ["Video", "Voice"], description: "Teaches mindfulness techniques to manage stress and improve overall well-being."}
];

function Therapy({ user, onUpdateUser }) {
    const [searchTerm, setSearchTerm] = useState('');
    const [languageFilter, setLanguageFilter] = useState('All');
    const [modeFilter, setModeFilter] = useState('All');
    const [filteredTherapists, setFilteredTherapists] = useState(allTherapists);

    useEffect(() => {
        let therapists = allTherapists;

        // Filter by search term (name or specialization)
        if (searchTerm) {
            therapists = therapists.filter(t => 
                t.name.toLowerCase().includes(searchTerm.toLowerCase()) || 
                t.specialization.toLowerCase().includes(searchTerm.toLowerCase())
            );
        }

        // Filter by language
        if (languageFilter !== 'All') {
            therapists = therapists.filter(t => t.languages.includes(languageFilter));
        }

        // Filter by session mode
        if (modeFilter !== 'All') {
            therapists = therapists.filter(t => t.modes.includes(modeFilter));
        }

        setFilteredTherapists(therapists);
    }, [searchTerm, languageFilter, modeFilter]);
    
    return (
        <div className="therapy-hub">
            <div className="therapy-header">
                <h2>Find Your Therapist</h2>
                <p>Connect with licensed professionals to support your mental wellness journey.</p>
            </div>

            <div className="filter-bar">
                <input 
                    type="text" 
                    placeholder="Search by name or specialty..."
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                />
                <select value={languageFilter} onChange={(e) => setLanguageFilter(e.target.value)}>
                    <option value="All">All Languages</option>
                    <option value="English">English</option>
                    <option value="Hindi">Hindi</option>
                    <option value="Gujarati">Gujarati</option>
                </select>
                <select value={modeFilter} onChange={(e) => setModeFilter(e.target.value)}>
                    <option value="All">All Session Modes</option>
                    <option value="Video">Video</option>
                    <option value="Voice">Voice</option>
                    <option value="Chat">Chat</option>
                </select>
            </div>

            <div className="therapists-grid">
                {filteredTherapists.length > 0 ? (
                    filteredTherapists.map(therapist => (
                        <div key={therapist.id} className="therapist-card">
                            <div className="therapist-card-header">
                                <div className="therapist-avatar">{therapist.avatar}</div>
                                <div className="therapist-header-info">
                                    <h4>{therapist.name}</h4>
                                    <p>{therapist.specialization}</p>
                                </div>
                            </div>
                            <div className="therapist-card-body">
                                <div className="therapist-stats">
                                    <span>‚≠ê {therapist.rating.toFixed(1)}</span>
                                    <span>{therapist.experience}</span>
                                    <span>‚Çπ{therapist.price}/session</span>
                                </div>
                                <div className="therapist-tags">
                                    {therapist.languages.map(lang => <span key={lang}>{lang}</span>)}
                                </div>
                                <p className="therapist-bio">{therapist.description}</p>
                            </div>
                            <div className="therapist-card-footer">
                                <button className="info-btn">View Profile</button>
                                <button className="book-btn">Book Session</button>
                            </div>
                        </div>
                    ))
                ) : (
                    <p className="no-results">No therapists found matching your criteria.</p>
                )}
            </div>
        </div>
    );
}

export default Therapy;
